import React from 'react';
import {
    Box,
    Typography,
    List,
    ListItem,
    ListItemText,
    ListItemSecondaryAction,
    IconButton,
    Tooltip
} from '@mui/material';
import RestoreIcon from '@mui/icons-material/Restore';
import DeleteIcon from '@mui/icons-material/Delete';

const SearchHistory = ({ history, onRestoreSearch, onDeleteSearch }) => {
    return (
        <Box sx={{ mt: 2 }}>
            <Typography variant="h6" gutterBottom>
                Siste søk
            </Typography>
            <List>
                {history.map((item) => (
                    <ListItem 
                        key={item.id}
                        sx={{
                            bgcolor: 'background.paper',
                            mb: 1,
                            borderRadius: 1,
                            '&:hover': {
                                bgcolor: 'action.hover'
                            }
                        }}
                    >
                        <ListItemText
                            primary={item.course_name}
                            secondary={new Date(item.created_at).toLocaleString('nb-NO')}
                        />
                        <ListItemSecondaryAction>
                            <Tooltip title="Gjenopprett søk">
                                <IconButton 
                                    edge="end" 
                                    onClick={() => onRestoreSearch(item)}
                                    sx={{ mr: 1 }}
                                >
                                    <RestoreIcon />
                                </IconButton>
                            </Tooltip>
                            <Tooltip title="Slett fra historikk">
                                <IconButton 
                                    edge="end" 
                                    onClick={() => onDeleteSearch(item.id)}
                                >
                                    <DeleteIcon />
                                </IconButton>
                            </Tooltip>
                        </ListItemSecondaryAction>
                    </ListItem>
                ))}
            </List>
        </Box>
    );
};

export default SearchHistory;
